import React from "react";
import { Box, Grid, FilledInput, Select, MenuItem, Dialog, DialogTitle, DialogContent, DialogActions } from "@material-ui/core";

export default (props) => {

  return(
    <Dialog open={true} fullWidth>
      <DialogTitle> Post Jobs </DialogTitle>
      <DialogContent>
        <Grid container>
          <Grid item xs={6}>
            <FilledInput placeholder="Jobs title *" disableUnderline fullWidth />          
          </Grid>

        </Grid>
      </DialogContent>
    </Dialog>
  )
}
